import React, { Component } from "react";
import "./CardDisplay.css";
import Card from "./Card";
const CardDisplay = ({ starWarsList }) => {
  return (
    <div className="CardDisplay">
      {starWarsList.results.map((user) => {
        return (
          <Card
            name={user.name}
            height={user.height}
            mass={user.mass}
            gender={user.gender}
          />
        );
      })}
    </div>
  );
};

export default CardDisplay;
